INSERT INTO `log` VALUES ('30', '4', '6', '1', '开题', '<p>广西科技大学</p>\n\n<p><strong>毕业设计</strong><strong>（</strong><strong>论文</strong><strong>）</strong><strong>开题报告</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><strong>课题名称&nbsp;&nbsp; 基于J2EE的公司员工日志管理系统的设计与实现 </strong></p>\n\n<p><img src=\"file:///C:\\Users\\ADMINI~1\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:4px; width:569px\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>系&nbsp;&nbsp;&nbsp; 别 &nbsp;&nbsp;&nbsp;理学院&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>专&nbsp;&nbsp;&nbsp; 业 &nbsp;&nbsp;&nbsp;信息与计算科学专业&nbsp;&nbsp;</p>\n\n<p>班&nbsp;&nbsp;&nbsp; 级 &nbsp;&nbsp;&nbsp;信计152&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>学&nbsp;&nbsp;&nbsp; 号 &nbsp;&nbsp;&nbsp;&nbsp;201500901055&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>姓&nbsp;&nbsp;&nbsp; 名 &nbsp;&nbsp;&nbsp;&nbsp;谢新权&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>指导教师 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;施业琼&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>2019年 3 月 2 日</p>\n\n<p>&nbsp;</p>\n\n<p>一 课题的研究目的及意义</p>\n\n<p>J2EE技术的基础就是核心Java平台或Java 2平台的标准版，J2EE不仅巩固了标准版中的许多优点，例如&quot;编写一次、随处运行&quot;的特性、方便存取数据库的JDBC API、CORBA技术以及能够在Internet应用中保护数据的安全模式等等，同时还提供了对EJB(Enterprise JavaBeans)、Java Servlets API、JSP(Java Server Pages)以及XML(标准通用标记语言 的子集)技术的全面支持。其最终目的就是成为一个能够使企业开发者大幅缩短投放市场时间的体系结构。基本J2EE技术能更好的去实现web项目的开发。</p>\n\n<p>目前，在现代社会工作中，出现了许多领导没有看到和发现员工的潜力，原因在于不知道员工每天做了什么、做了多少努力，员工的努力得不到认可，致使许多员工与领导之间产生不少矛盾。公司越大，管理员越难发现底层员工的潜力，也难以筛选出优秀的员工进行提拔。员工日志管理系统能让管理者发现优秀员工，通过阅读员工每天工作后写的日志就可了解每个员工的工作内容，对每个员工进行判断，对于每个员工的能力优势进行合理发挥，以发挥员工的潜力，相应的也可以对一些混水摸鱼的员工进行相应的惩罚。以此，对于公司的发展壮大必然有巨大的好处。</p>\n\n<p><strong>二 国内外研究现状及发展趋势</strong></p>\n\n<p>随着现代化的不断加剧，公司的发展和竞争剧烈，公司员工的能力很大程度决定了公司的发展，日志办公管理系统也应运而生。无论国内国外，这种日志产品都有在开发和使用中，但由于对每个公司的工作实情和内容不大相一致，并且每个公司都很担心数据的丢失和泄露，对于公司的发展有一定的危害。在越来越多的应用中，这种日志管理会得到更大的发展和优化。</p>\n\n<p><strong>三 本课题研究的内容及预期目标</strong></p>\n\n<p>本设计针对公司管理员去发现员工的潜力了解不足的情况，研究和设计实现一个方便管理员去发现员工的潜力的系统。员工日志管理系统的实现使得以前由管理员亲临视察到向网络的发展，是现代公司对员工管理的一个飞跃。对于该系统的预期目标有：每个员工可登录系统进行每日工作的记录，或者查看他人日志来比对自己的不足，若员工发起请假申请，管理员审批通过，当日可不写日志；公司管理员根据自己公司的实际情况进行日志模板的创建，管理员查看员工提交的日志，评论该日志内容，以及对该条日志进行审批点赞、撤销、拒绝。系统管理员则拥有最高的权限，系统管理员可以对所有的信息进行管理维护，以满足公司各方面的要求，这样更方便公司对员工日志管理系统的使用。</p>\n\n<p><strong>四 课题研究思路、研究方法及步骤</strong></p>\n\n<p><strong>本设计主要有公司管理员模块和员工模块。在系统管理员中添加管理员账号，管理员登陆添加员工。员工和管理员登录后，后台判断后会加载出不同的菜单，可通过点击来加载不同的功能。数据界面采用JqGrid进行加载展示，同时结合html+css对界面进行美观。基于J2EE环境，同时支持springmvc的三层（m:业务层；v:视图层以及c:控制层）分层思想进行业务逻辑的处理，对本系统的所有功能实现。</strong></p>\n\n<p><strong>五 进度安排</strong></p>\n\n<p>2月20日-2月21日：做一些开始的准备工作，如搭建系统开发所需环境；</p>\n\n<p>2月22日-2月25日：外文资料查找和外文翻译；</p>\n\n<p>2月26日-2月28日：撰写课题任务书和开题报告；</p>\n\n<p>3月1日-3月4日：总体设计和资料的查询，如在图书馆上网查找相关文献资料；</p>\n\n<p>3月5日-4月20日：详细设计阶段，包括编程，调试，验证修改；</p>\n\n<p>4月21日-4月30日：论文初稿；</p>\n\n<p>5月1日-5月5日：论文第一次修改；</p>\n\n<p>5月6日-5月10日：论文第二次修改。</p>\n\n<p><strong>六 提交的材料</strong></p>\n\n<p>外文翻译；</p>\n\n<p>开题报告；</p>\n\n<p>软件成品；</p>\n\n<p>毕业论文；</p>\n\n<p>毕业设计指导记录手册。</p>\n\n<p><strong>七 参考文献和资料</strong></p>\n\n<p>[1] 孙卫琴著．Tomcat与Java Web开发技术详解． -北京：电子工业出版社，2009</p>\n\n<p>[2] 陈雄华著．Spring 企业级应用开发详解[M]． -北京：电子工业出版社，2009</p>\n\n<p>[3] 霍斯特曼科内尔著．Java 核心技术[M]． -北京：机械工业出版社，2014</p>\n\n<p>[4] 贺松平著．基于 MVC 模式的 B/S 架构的研究与应用． -武汉：华中科技大学，2009</p>\n\n<p>[5] 李刚著．轻量级 J2EE 企业应用实战[M]． -北京：电子工业出版社，2007</p>\n\n<p>[6] 马运涛著．Eclipse 精要与高级开发技术[D]． -北京：电子工业出版社，2007</p>\n\n<p>[7] 赵利庆著．Java Web架构中数据库优化模式的研究与实现[D]． -北京：北京邮电大学，2015</p>\n\n<p>[8] 周爱民著．JavaScript 语言精髓与编程实践[M]． -北京：电子工业出版社，2012</p>\n\n<p>[9] 赵利庆著．Java Web架构中数据库优化模式的研究与实现[D]． -北京：北京邮电大学，2015</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', '1', null, '2019-04-16 14:05:00');
INSERT INTO `log` VALUES ('31', '6', '3', '1', '啊啊', '<p>所谓物料仓储管理制度体系，就是指按照物料仓储管理系统构成的要求，将指导工作的原则性 准则与方法进行高度概括性的汇总，从而形成一套行之有效、完整的管理制度体系。物料仓储管理 制度就是确保物料管理工作正常进行的坚实基矗 　　建立物料仓储管理制度体系的思路最初来源于iso9000标准的管理方法。iso9000文件系统中的 重要文件之一就就是质量手册，物料仓储管理制度体系实际上就就是iso9000质量手册在制造企业物 料管理工作中的具体应用，它清晰、明确地规定了企业进行物料仓储管理的总原则。 　　物料仓储管理系统就是按照物料仓储管理的系统构成，汇总了指导性准则的管理制度。物料仓 储系统的构成主要包括八个方面：物料分类、存量控制、成品仓储、滞料和废料、采购等五种管理 和验收、仓储、物料收发等三种作业。 　　物料仓储管理系统的各方面都具体规定了一系列的管理目标。其中，进行物料分类管理可以将 物料规划得有条不紊，存量控制使得仓储的物料所占用的资金最少，对采购回来的物料进行验收后 储存进仓库，完成负责物料的领发作业。 　　我在公司的工作职位就是仓库现场操作工，我对该公司也有了明确的了解，公司就是一个物流 方面的公司，本人在学校学习的专业就是报关与国际货运，工作类型可以说就是与我所学专业对口 的，在这个公司实习正就是对我所学知识的补充也就是我在学校所学知识的进一步升华，对我踏入 社会、步入人生有着至关重要的影响。 　　时间不长，我来公司已经有3个多月了，在实习期间，领导和同事们不仅认真指导我们的工作平 时还特别关心我们的生活，给予了我足够的宽容、支持与帮助。在这里，我想感谢所有在这段时间 里帮助过我的人。感谢他们让我不断进步，我不会辜负他们对我的期望，努力工作、努力学习，将 来为社会做出更大的贡献。</p>\n\n<p>最后，通过实习，通过我对中国物流行业的简单了解，总结出，中国的物流行业并不就是很成 熟，在今后的生活中我一定会不断努力，丰富自已，用我所学习的知识，来为中国的物流行业做出 贡献。虽然目前的中国物流业水平并不可观，但就是，我坚信：中国定将繁荣发展，中国的物流业 也定将蓬勃发展，达到国际领先水平！</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', '1', null, '2019-04-16 19:50:19');
