INSERT INTO `log` VALUES ('46', '4', '9', '1', 's', '<p>5月9日下午，校党委理论学习中心组在东环校区行政办公楼6&mdash;1会议室召开学习会，传达学习自治区党委教育工委高校专项工作会议精神和习近平总书记在纪念五四运动100周年大会上的重要讲话精神。校党委常委覃伟年、李思敏、张正义、覃萍、李利军、徐武彬、韦锦义、张发钦、蔡亮，全体校党委理论学习中心组成员参加会议。会议由校党委副书记、纪委书记张正义主持。</p>\n\n<p>校党委副书记覃萍传达学习了自治区党委教育工委高校专项工作会议精神，对做好学校下一步的宗教工作进行了部署，要求各基层党组织、各单位进一步强化责任意识，守土有责、守土负责、守土尽责，加强协作配合，形成工作合力，有效维护校园和谐稳定。</p>\n\n<p>党委学生工作部部长、学生工作处处长陈克文，党委研究生工作部部长、研究生工作处处长廖志高，校团委书记朱广生，结合工作实际，就如何学习贯彻习近平总书记在纪念五四运动100周年大会上的重要讲话精神作了中心发言。</p>\n\n<p>校党委书记覃伟年作总结讲话。为做好学校宗教工作，他强调：全校各级党组织、各单位一要提高政治站位，认清做好宗教工作的极端重要性；二要积极开展宗教政策法规宣传教育，提高师生政治敏感性，保持清醒头脑，筑牢思想防线，坚决抵制宗教渗透；三要强化责任担当，把握宗教工作主动权，抓好基础工作，防患于未然；四要不断健全协同配合工作机制，加强联动联防；五要完善学生服务管理机制，充分发挥思政干部队伍的作用。为学习好贯彻好落实好习近平总书记在纪念五四运动100周年大会上的重要讲话精神，他指出：习近平总书记的重要讲话深刻阐释了五四运动的历史意义和五四精神的时代价值，对青年一代弘扬伟大五四精神、奋力担当时代使命寄予了殷切期望，对做好新时代党的青年工作提出了重要要求；全校各级党组织、各单位要把认真学习宣传贯彻落实习近平总书记在纪念五四运动100周年大会上的重要讲话精神与习近平总书记在全国教育大会上的重要讲话精神、与学习自治区党委书记鹿心社在全区省级领导和厅级主要负责同志专题研讨班上的讲话精神结合起来、与学校重点工作难点工作特别是&ldquo;三全育人&rdquo;工作结合起来，深入挖掘五四运动的精神力量，把爱党爱国爱社会主义教育贯穿于教学、育人全过程，将青年师生凝聚在党的周围，全面落实立德树人根本任务，努力培养德智体美劳全面发展的社会主义建设者和接班人。</p>\n', '1', null, '2019-05-11 16:13:21');
